import React from 'react';
import ServiceCard from '../components/ServiceCard';
import Hero from '../components/Hero';

export default function Home() {
  return (
    <>
        <Hero />
       <main className="text-center mt-12">
        <section className="grid gap-6 sm:grid-cols-3">
          <ServiceCard title="Natural Coloring" description="Ammonia-free mineral hair dye." />
          <ServiceCard title="Scalp & Hair Care" description="Advanced scalp & hair treatments." />
          <ServiceCard title="Wellness Foods" description="Functional health supplements." />
        </section>
      </main>
    </>
  );
}
